function setEventListeners(){

    document.addEventListener("keydown", function(event) {

        var key = event.keyCode; // ASCII
        if (!pause && !gameover){

            switch (key) {
                //left
                case 37 : //left arrow
                case 65 : // A
                    if(tplayer < -0.85){
                        break;
                    }
                    tplayer -= 0.12;
                    break;

                //right
                case 39 : //right arrow
                case 68 : // D
                    if(tplayer > 0.85){
                        break;
                    }
                    tplayer += 0.12;
                    break;
            }

        }

    });

    document.addEventListener("keypress", function(event) {

        var key = event.keyCode; // ASCII

        switch (key) {

            //shoot or restart
            case 32 : // space bar
            case 119 : // w
                if (!pause && !gameover && bulletready) { // shoot
                    tybullet = -0.75;
                    txbullet = tplayer;
                    if(!muted)
                        shootaudio.play();
                    bulletready = false;
                }

                break;
            case 114: // R
                if (gameover) { // restart game

                    resetlevel();

                    if(!muted)
                        alestorm.play();

                    level = 1;
                    points = 0;

                    document.getElementById('myLink').innerHTML = "Destroy all invaders!!";
                    document.getElementById('right').innerHTML = "Level: 1 <br> Points: 0";

                    gameover = false;

                }
                break;

            //pause
            case 112 : // P
                if (!gameover) {
                    pause = !pause;
                    if(pause){
                        if(!muted)
                            pauseaudio.play();
                        alestorm.pause();
                    }
                    else{
                        if(!muted)
                            alestorm.play();
                        pauseaudio.pause();
                        pauseaudio.currentTime = 0;
                    }
                    if (pause) document.getElementById('myLink').innerHTML = "Game Paused";
                    else document.getElementById('myLink').innerHTML = "Destroy all invaders!!";
                    break;
                }
        }
    });
}

//----------------------------------------------------------------------------
//
// WebGL Initialization
//

function initWebGL( canvas ) {
	try {
		
		// Create the WebGL context
		
		// Some browsers still need "experimental-webgl"
		
		gl = canvas.getContext("webgl") || canvas.getContext("experimental-webgl");
		
		// DEFAULT: The viewport occupies the whole canvas 
		
		// DEFAULT: The viewport background color is WHITE
		
		// NEW - Drawing the triangles defining the model
		
		primitiveType = gl.TRIANGLES;
		
		// DEFAULT: Face culling is DISABLED
		
		// Enable FACE CULLING
		
		gl.enable( gl.CULL_FACE );
		
		// DEFAULT: The BACK FACE is culled!!
		
		// The next instruction is not needed...
		
		gl.cullFace( gl.BACK );

		// Enable DEPTH-TEST
		
		gl.enable( gl.DEPTH_TEST );        
	} catch (e) {
	}
	if (!gl) {
		alert("Could not initialise WebGL, sorry! :-(");
	}        
}

//----------------------------------------------------------------------------

function runWebGL() {

	var canvas = document.getElementById("my-canvas");
	
	initWebGL( canvas );

	shaderProgram = initShaders( gl );
	
	setEventListeners();
	
	initBuffers();
	
	tick();		// NEW --- A timer controls the rendering / animation

	outputInfos();
}

